Once per turn: You can activate 1 of these effects (but you can only use each effect of "Eternal Favorite" once per turn);
<br>• Special Summon 1 of your "Yubel" monsters that is banished or in your GY. Neither player can activate cards or effects when that monster is Special Summoned.
<br>• If you control "Yubel": Discard 1 card and send this face-up card to the GY; Fusion Summon 1 Fusion Monster from your Extra Deck, using monsters from either field as material, including a "Yubel" monster.
